import React, { useEffect, useState } from "react";
import Tree from "react-d3-tree";
import styles from "./TreeComponent.module.css";
import CenteredTree from "./CenteredTree";

const checkSender = el => {
  if (el.name === "Top Level") {
    return el;
  }
};

const TreeComponent = () => {
  const [nodes, setNodes] = [{ name: "Undefined" }];

  useEffect(() => {
    fetch("http://192.168.43.70:5000/transfer", {
      method: "GET"
    })
      .then(function(response) {
        if (response.status >= 400) {
          throw new Error("Bad response from server");
        }
        return response.json();
      })
      .then(function(data) {
        const newNodes = [{ name: "hello", children: [] }];
        console.log(data);
        data.forEach(element => {
          fetch("http://192.168.43.70:5000/transfers", {
            method: "POST",
            body: JSON.stringify(element)
          })
            .then(function(response) {
              if (response.status >= 400) {
                throw new Error("Bad response from server");
              }

              return response.json();
            })
            .then(function(data) {
              console.log(data);
              newNodes.find(el => {
                console.log(el.name);
                if (el.name !== "hello") return el.name;
              });
            });
        });
      });
  }, []);

  //addArrayEntry();
  return (
    <div className={styles.tree}>
      <CenteredTree data={nodes} orientation="vertical" />;
    </div>
  );
};

export default TreeComponent;
